import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById('root'));  // Correct method for React 18
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

